
CREATE TABLE GLSUBF(
	GL23MARC VARCHAR(2) NOT NULL,
	GL23TAG VARCHAR(4) NOT NULL,
	GL23INDI1 CHAR(1) NOT NULL,
	GL23INDI2 CHAR(1) NOT NULL,
	GL23SUBF CHAR(1) NOT NULL,
	GL23DESC VARCHAR(100),
	GL23REPEAT CHAR(1),
	GL23MANDA CHAR(1),
	GL23ACTION CHAR(1),
	GL23CREDATE VARCHAR(8),
	GL23CRETIME VARCHAR(8),
	GL23PATR VARCHAR(12),
	GL23PUNCT VARCHAR(50),
	GL23TABNAME VARCHAR(6),
	GL23FILE CHAR(1),
	CONSTRAINT PK_GLSUBF PRIMARY KEY(GL23MARC,GL23TAG,GL23INDI1,GL23INDI2,GL23SUBF));


